import React from 'react';
import { Route } from "react-router-dom";
import PhotoList from "./pages/photoList.js";

function App () {
  return (
    <div className="App">
      <Routes>
      <Route exact path="/" component={PhotoList}></Route>
      </Routes>
    </div>
  );
}


export default App;
